  \"Western Monarch and Milkweed Habitat Suitability Modeling Project- March 2016
  Final Presentation\",\n\t\"tracking_summary\": {\n\t\t\"total\": 8,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:06:55.295417\",\n\t\"name\": \"western-monarch-and-milkweed-habitat-suitability-modeling-project-march-2016-final-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To better understand the distribution of
  key breeding areas for the declining western population of monarch butterflies,
  the USFWS, in collaboration with the Xerces Society, developed a set of relative
  habitat suitability models. This effort, which took place between Feb. 2015 and
  Feb. 2016, involved compilation of all available western milkweed and monarch species
  observation data, field surveys to acquire new data in summer 2016, and Maximum
  Entropy (MaxEnt) modeling in R. Products include relative habitat suitability models
  of five milkweed species thought to be important to western monarchs that enough
  data points to allow for creation of reasonably robust models.  The species are
  Asclepias speciosa (showy milkweed), Asclepias fascicularis (narrowleaf milkweed),
  Asclepias eriocarpa (woollypod milkweed), Asclepias asperula (antelope horn or spider
  milkweed), and Asclepias cordifolia (heartleaf milkweed). These models were developed
  by correlating a set of environmental covariates to the known occurrence points.
  A different subset of uncorrelated variables was selected for each species from
  a set of 25 possible covariate rasters. A model of monarch breeding habitat suitability
  was also developed, by correlated known monarch breeding habitat points to as an
  uncorrelated subset of the environmental  covariates  as well as the habitat suitability
  models already developed for the 5 milkweed species. All of these models are being
  distributed via ServCat in their original 270m pixel resolution for use by the USFWS
  and its partners. These models are imperfect because they are based on limited and
  spatially biased data, but it is appropriate to use them to help plan prioritize
  habitat improvement actions at a regional scale, and to identify areas for 2016
  surveys. Locations that show up as having high relative suitability but do not have
  known occurrences would be especially valuable to survey. Another publically distributed
  product of this project are the input environmental covariate rasters that used
  to develop the MaxEnt models. There 25 raster layers were prepared at 3 different
  resolutions: 90m pixels, 270m pixels, and 900m pixels. We experimented with all
  three resolutions, but the 270m rasters proved most appropriate given the spatial
  inaccuracy of the species locations, the coarse resolution of the input climate
  rasters, and computational constraints. All 3 resolutions are provided, not just
  for methodological transparency, but because they could save someone who wished
  to develop a similar habitat suitability model a great deal of time.  As of 2/25/2016,
  two other key products of this effort are still in draft. These are a geospatial
  database of milkweed and monarch observations and a manuscript that fully describes
  the methods used to generate the MaxEnt models. This document will be submitted
  for peer review in an open journal, and will be posted on ServCat once published.\",\n\t\"license_title\":
